const images = [
    { src: '../vids/sf.mp4', },
    { src: '../vids/vid.mp4', },
    { src: '../vids/vid1.mp4', },
    { src: '../vids/vid2.mp4', },
    { src: '../vids/vid3.mp4', },
    { src: '../vids/vid4.mp4', },
    { src: '../vids/vid5.mp4', }
  ];

function imageLoader() {
    return images;
}
  
export default imageLoader;
